window.bookSummaryJSON = "<p><b>She's everything I was never supposed to want.</b></p> <p><b>Dominic</b></p> <p>Eighteen years old, a Bratva princess, and Lev Melnikov's daughter.</p> <p>That should be enough to keep me away, but the second I see Natalya all grown up, I know she's mine.</p> <p>I try to fight what I feel for her, but my principessa is determined to bring me to my knees, and she's willing to do whatever it takes to get me there.</p> <p><b>Natalya</b></p> <p>He's the head of the Alessi family, more than twice my age, and friends with my dad.</p> <p>That should be enough to keep me away, but I'm lost to him the second he comes back to America wearing his signature Armani suit and sexy smile.</p> <p>He tries to fight his attraction, but when a dangerous situation lands me at his house and under his protection, I know it's only a matter of time before he takes what he wants.</p> <p>Loving Dominic is dangerous, but being possessed by him might just destroy me.</p> <p><i>This is a very steamy dark mafia romance, and it does contain a large age gap. For mature listeners.</i></p>"; 
